import{_ as s,o as a,c as o,Q as n}from"./chunks/framework.c932f925.js";const e="/iroha-2-docs/assets/install-troubles.36e7cc47.png",b=JSON.parse('{"title":"Troubleshooting Installation Issues","description":"","frontmatter":{},"headers":[],"relativePath":"guide/troubleshooting/installation-issues.md","lastUpdated":1682419675000}'),l={name:"guide/troubleshooting/installation-issues.md"},t=n('<h1 id="troubleshooting-installation-issues" tabindex="-1">Troubleshooting Installation Issues <a class="header-anchor" href="#troubleshooting-installation-issues" aria-label="Permalink to &quot;Troubleshooting Installation Issues&quot;">​</a></h1><p>This section offers troubleshooting tips for issues with Iroha 2 installation. If the issue you are experiencing is not described here, contact us via <a href="https://t.me/hyperledgeriroha" target="_blank" rel="noreferrer">Telegram</a>.</p><h2 id="troubleshooting-rust-toolchain" tabindex="-1">Troubleshooting Rust Toolchain <a class="header-anchor" href="#troubleshooting-rust-toolchain" aria-label="Permalink to &quot;Troubleshooting Rust Toolchain&quot;">​</a></h2><p>Sometimes, things don’t go as planned. Especially if you had <code>rust</code> on your system a while ago, but didn’t upgrade. A similar problem can occur in Python: XKCD has a famous example of what that might look like:</p><div class="flex justify-center"><p><img src="'+e+`" alt="Untitled"></p></div><h3 id="check-rust-version" tabindex="-1">Check Rust version <a class="header-anchor" href="#check-rust-version" aria-label="Permalink to &quot;Check Rust version&quot;">​</a></h3><p>In the interest of preserving both your and our sanity, make sure that you have the right version of <code>cargo</code> paired with the right version of <code>rustc</code> (1.57 and 1.57) respectively. To show the versions, do</p><div class="language-bash"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki github-dark-dimmed"><code><span class="line"><span style="color:#F69D50;">$</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">cargo</span><span style="color:#ADBAC7;"> </span><span style="color:#6CB6FF;">-V</span></span>
<span class="line"><span style="color:#F69D50;">$</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">cargo</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">1.60.0</span><span style="color:#ADBAC7;"> (</span><span style="color:#F69D50;">d1fd9fe</span><span style="color:#ADBAC7;"> </span><span style="color:#6CB6FF;">2022</span><span style="color:#96D0FF;">-</span><span style="color:#F47067;">0</span><span style="color:#6CB6FF;">3</span><span style="color:#96D0FF;">-</span><span style="color:#F47067;">0</span><span style="color:#6CB6FF;">1</span><span style="color:#ADBAC7;">)</span></span>
<span class="line"></span></code></pre></div><p>and then</p><div class="language-bash"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki github-dark-dimmed"><code><span class="line"><span style="color:#F69D50;">$</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">rustc</span><span style="color:#ADBAC7;"> </span><span style="color:#6CB6FF;">--version</span></span>
<span class="line"><span style="color:#F69D50;">$</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">rustc</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">1.60.0</span><span style="color:#ADBAC7;"> (7737e0b5c </span><span style="color:#6CB6FF;">2022</span><span style="color:#ADBAC7;">-</span><span style="color:#F47067;">0</span><span style="color:#6CB6FF;">4</span><span style="color:#ADBAC7;">-</span><span style="color:#F47067;">0</span><span style="color:#6CB6FF;">4</span><span style="color:#ADBAC7;">)</span></span>
<span class="line"></span></code></pre></div><p>If you have higher versions, you&#39;re fine. If you have lower versions, you can run the following command to update it:</p><div class="language-bash"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki github-dark-dimmed"><code><span class="line"><span style="color:#F69D50;">$</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">rustup</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">toolchain</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">update</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">stable</span></span>
<span class="line"></span></code></pre></div><h3 id="check-installation-location" tabindex="-1">Check installation location <a class="header-anchor" href="#check-installation-location" aria-label="Permalink to &quot;Check installation location&quot;">​</a></h3><p>If you get lower version numbers <strong>and</strong> you updated the toolchain and it didn’t work… let’s just say it’s a common problem, but it doesn’t have a common solution.</p><p>Firstly, you should establish where the version that you want to use is installed:</p><div class="language-bash"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki github-dark-dimmed"><code><span class="line"><span style="color:#F69D50;">$</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">rustup</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">which</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">rustc</span></span>
<span class="line"><span style="color:#F69D50;">$</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">rustup</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">which</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">cargo</span></span>
<span class="line"></span></code></pre></div><p>User installations of the toolchains are <em>usually</em> in <code>~/.rustup/toolchains/stable-*/bin/</code>. If that is the case, you should be able to run</p><div class="language-bash"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki github-dark-dimmed"><code><span class="line"><span style="color:#F69D50;">$</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">rustup</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">toolchain</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">update</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">stable</span></span>
<span class="line"></span></code></pre></div><p>and that should fix your problems.</p><h3 id="check-the-default-rust-version" tabindex="-1">Check the default Rust version <a class="header-anchor" href="#check-the-default-rust-version" aria-label="Permalink to &quot;Check the default Rust version&quot;">​</a></h3><p>Another option is that you have the up-to-date <code>stable</code> toolchain, but it is not set as the default. Run:</p><div class="language-bash"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki github-dark-dimmed"><code><span class="line"><span style="color:#F69D50;">$</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">rustup</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">default</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">stable</span></span>
<span class="line"></span></code></pre></div><p>This can happen if you installed a <code>nightly</code> version, or set a specific Rust version, but forgot to un-set it.</p><h3 id="check-if-there-are-other-rust-versions" tabindex="-1">Check if there are other Rust versions <a class="header-anchor" href="#check-if-there-are-other-rust-versions" aria-label="Permalink to &quot;Check if there are other Rust versions&quot;">​</a></h3><p>Continuing down the troubleshooting rabbit-hole, we could have shell aliases:</p><div class="language-bash"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki github-dark-dimmed"><code><span class="line"><span style="color:#F69D50;">$</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">type</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">rustc</span></span>
<span class="line"><span style="color:#F69D50;">$</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">type</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">cargo</span></span>
<span class="line"></span></code></pre></div><p>If these point to locations other than the one you saw when running <code>rustup which *</code>, then you have a problem. Note that it’s not enough to just</p><div class="language-bash"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki github-dark-dimmed"><code><span class="line"><span style="color:#F69D50;">$</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">alias</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">rustc</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">&quot;~/.rustup/toolchains/stable-*/bin/rustc&quot;</span></span>
<span class="line"><span style="color:#F69D50;">$</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">alias</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">cargo</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">&quot;~/.rustup/toolchains/stable-*/bin/cargo&quot;</span></span>
<span class="line"></span></code></pre></div><p>because there is an internal logic that could break, regardless of how you re-arrange your shell aliases.</p><p>The simplest solution would be to remove the versions that you don’t use.</p><p>It’s easier <em>said</em> than <em>done</em>, however, since it entails tracking all the versions of rustup installed and available to you. Usually, there are only two: the system package manager version and the one that got installed into the standard location in your home folder when you ran the command in the beginning of this tutorial. For the former, consult your (Linux) distribution’s manual, (<code>apt remove rust</code>). For the latter, run:</p><div class="language-bash"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki github-dark-dimmed"><code><span class="line"><span style="color:#F69D50;">$</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">rustup</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">toolchain</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">list</span></span>
<span class="line"></span></code></pre></div><p>And then, for every <code>&lt;toolchain&gt;</code> (without the angle brackets of course):</p><div class="language-bash"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki github-dark-dimmed"><code><span class="line"><span style="color:#F69D50;">$</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">rustup</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">remove</span><span style="color:#ADBAC7;"> </span><span style="color:#F47067;">&lt;</span><span style="color:#96D0FF;">toolchai</span><span style="color:#ADBAC7;">n</span><span style="color:#F47067;">&gt;</span></span>
<span class="line"></span></code></pre></div><p>After that, make sure that</p><div class="language-bash"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki github-dark-dimmed"><code><span class="line"><span style="color:#F69D50;">$</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">cargo</span><span style="color:#ADBAC7;"> </span><span style="color:#6CB6FF;">--help</span></span>
<span class="line"></span></code></pre></div><p>results in a command-not-found error, i.e. that you have no active Rust toolchain installed. Then, run:</p><div class="language-bash"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki github-dark-dimmed"><code><span class="line"><span style="color:#F69D50;">$</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">rustup</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">toolchain</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">install</span><span style="color:#ADBAC7;"> </span><span style="color:#96D0FF;">stable</span></span>
<span class="line"></span></code></pre></div>`,38),p=[t];function r(c,i,h,u,d,y){return a(),o("div",null,p)}const D=s(l,[["render",r]]);export{b as __pageData,D as default};
